    'Carrier name displayed during checkout' => 'வெளியேறுதலின் போது காட்டப்படும் ஊர்தியின் பெயர்',
    'Upload a logo from your computer.' => 'உங்கள் கணினியில் இருந்து ஒரு லோகோ\'வை பதிவேற்றவும்.',
    'or' => 'அல்லது',
    'Estimated delivery time will be displayed during checkout.' => 'வெளியேறுதலின் போது உத்தேச பட்டுவாடா நேரம் காட்டப்படும்.',
    'Delivery tracking URL: Type \'@\' where the tracking number should appear. It will then be automatically replaced by the tracking number.' => 'பட்டுவாடாவின் தடமறியும் URL : தடமறியும் எண் இட வேண்டிய இடத்தில் \'@\' என்று இடவும். இவ்வாறு இடுவதால் @க்கு பதிலாக தடமறியும் எண் தானாக மாற்றப்படும்.',
    'The zones in which this carrier will be used.' => 'இந்த ஊர்தி பயன்படுத்தப்படும் மண்டலங்கள்.',
    'Group access' => 'குழு அணுகல்',
    'Apply both regular shipping cost and product-specific shipping costs.' => 'வழக்கமான பட்டுவாடா செலவையும் குறிப்பிட்ட பொருளின் பட்டுவாடா செலவையும் இடு.',
    'Include the shipping and handling costs in the carrier price.' => 'ஊர்தி விலையில் பட்டுவாடா மற்றும் கையாளுதல் செலவை சேர்.',
    'Apply the cost of the highest defined range' => 'அதிகபட்ச வரையறுக்கப்பட்ட எல்லையின் செலவை இடு',
    'Out-of-range behavior occurs when none is defined (e.g. when a customer\'s cart weight is greater than the highest range limit).' => 'எதுவும் வரையறுக்கப்படாமல் இருக்கையில் வரம்புக்கு அப்பால் நிலை நடத்தை ஏற்படும். (உ. வாடிக்கையாளரின் பொருட்கூடையில்  உள்ள பொருட்களின் எடை வரையறுக்கப்பட்ட அதிகபட்ச எடையை விட அதிகமாக இருக்கும் போது).',
    'Maximum height managed by this carrier. Set the value to "0," or leave this field blank to ignore.' => 'இந்த ஊர்தி கையாளக் கூடிய அதிகபட்ச உயரம். இதை தவிர்க்க இதன் மதிப்பை "0" என்று இடவும் அல்லது இந்த புலத்தை காலியாக விடவும்.',
    'Maximum width managed by this carrier. Set the value to "0," or leave this field blank to ignore.' => 'இந்த ஊர்தி கையாளக் கூடிய அதிகபட்ச அகலம். இதை தவிர்க்க இதன் மதிப்பை "0" என்று இடவும் அல்லது இந்த புலத்தை காலியாக விடவும்.',
    'Maximum depth managed by this carrier. Set the value to "0," or leave this field blank to ignore.' => 'இந்த ஊர்தி கையாளக் கூடிய அதிகபட்ச ஆழம். இதை தவிர்க்க இதன் மதிப்பை "0" என்று இடவும் அல்லது இந்த புலத்தை காலியாக விடவும்.',
    'Maximum weight managed by this carrier. Set the value to "0," or leave this field blank to ignore.' => 'இந்த ஊர்தி கையாளக் கூடிய அதிகபட்ச எடை. இதை தவிர்க்க இதன் மதிப்பை "0" என்று இடவும் அல்லது இந்த புலத்தை காலியாக விடவும்.',
    'For in-store pickup, enter 0 to replace the carrier name with your shop name.' => 'நேரடி கொள்முதலாக இருந்தால் ஊர்தியின் பெயருக்கு பதில் உங்கள் கடையின் பெயரை போட 0 என்று இடவும்.',
    'Enter "0" for a longest shipping delay, or "9" for the shortest shipping delay.' => 'மிக நீண்ட பட்டுவாடா காலத்திற்கு "0", அல்லது குறுகிய பட்டுவாடா காலத்திற்கு "9" என்று இடவும்.',
    'Mark the groups that are allowed access to this carrier.' => 'இந்த ஊர்தியை அணுக அனுமதிக்கப்ட்ட குழுக்களை குறி.',
    'Allowed characters: letters, spaces and "%s".' => 'அனுமதிக்கப்பட்ட உருக்கள் : எழுத்துகள், இடைவெளிகள் மற்றும் %s.',
    'The carrier\'s name will be displayed during checkout.' => 'வெளியேறுதலின் போது ஊர்தியின் பெயர் காட்டப்படும்.',
    'Delivery tracking URL: Type \'@\' where the tracking number should appear. It will be automatically replaced by the tracking number.' => 'பட்டுவாடாவின் தடமறியும் URL : தடமறியும் எண் இட வேண்டிய இடத்தில் \'@\' என்று இடவும். இவ்வாறு இடுவதால் @க்கு பதிலாக தடமறியும் எண் தானாக மாற்றப்படும்.',
    'Out-of-range behavior occurs when no defined range matches the customer\'s cart (e.g. when the weight of the cart is greater than the highest weight limit defined by the weight ranges).' => 'வரையறுக்கப்பட்ட வரம்பு எல்லை எதுவும் வாடிக்கையாளரின் கூடையுடன் பொருந்தாத நிலையில் வரம்புக்கு அப்பால் நிலை நடத்தை ஏற்படும் (உ. கூடையின் எடை வரையறுக்கப்பட்ட அதிகபட்ச எடையை விட அதிகமாக இருக்கும் போது).',
    'Maximum width managed by this carrier. Set the value to "0", or leave this field blank to ignore.' => 'இந்த ஊர்தி கையாளக் கூடிய அதிகபட்ச அகலம். இதை தவிர்க்க இதன் மதிப்பை "0" என்று இடவும் அல்லது இந்த புலத்தை காலியாக விடவும்.',
    'The value must be an integer.' => 'இதன் மதிப்பு ஒரு முழுஎண்ணாக இருக்க வேண்டும்.',
    'Maximum height managed by this carrier. Set the value to "0", or leave this field blank to ignore.' => 'இந்த ஊர்தி கையாளக் கூடிய அதிகபட்ச உயரம். இதை தவிர்க்க இதன் மதிப்பை "0" என்று இடவும் அல்லது இந்த புலத்தை காலியாக விடவும்.',
    'Maximum depth managed by this carrier. Set the value to "0", or leave this field blank to ignore.' => 'இந்த ஊர்தி கையாளக் கூடிய அதிகபட்ச ஆழம். இதை தவிர்க்க இதன் மதிப்பை "0" என்று இடவும் அல்லது இந்த புலத்தை காலியாக விடவும்.',
    'Maximum weight managed by this carrier. Set the value to "0", or leave this field blank to ignore.' => 'இந்த ஊர்தி கையாளக் கூடிய அதிகபட்ச உயரம். இதை தவிர்க்க இதன் மதிப்பை "0" என்று இடவும் அல்லது இந்த புலத்தை காலியாக விடவும்.',
